CREATE TABLE `md_media` (
  `key` int(11) NOT NULL auto_increment,
  `ASIN` varchar(100) collate latin1_general_ci default NULL,
  `UPC` varchar(100) collate latin1_general_ci default NULL,
  `name` varchar(150) collate latin1_general_ci NOT NULL default '',
  `type` varchar(20) collate latin1_general_ci NOT NULL default '',
  `picture` varchar(250) collate latin1_general_ci default NULL,
  `is_loaned` int(1) NOT NULL default '0',
  `loaned_to` varchar(150) collate latin1_general_ci default NULL,
