CREATE TABLE `st_store` (
  `key` int(11) NOT NULL auto_increment,
  `store_purchased` varchar(100) collate latin1_general_ci NOT NULL default '',
  `date_purchased` date NOT NULL default '0000-00-00',
  `purchased_by` varchar(100) collate latin1_general_ci NOT NULL default '',
  `price` decimal(10,2) default NULL,
  `unit_price` decimal(10,2) default NULL,
  `warranty_price` decimal(10,2) default NULL,
  `coupon_amt` decimal(10,2) default NULL,
  `gift_card` decimal(10,2) default NULL,
  `is_gift` int(1) NOT NULL default '0',
  `has_receipt` int(1) NOT NULL default '1',
  `date_warranty` date default NULL,
  `warranty_info` text collate latin1_general_ci,
  `date_created` datetime NOT NULL default '0000-00-00 00:00:00',
  `date_updated` datetime NOT NULL default '0000-00-00 00:00:00',
  `module` varchar(4) collate latin1_general_ci NOT NULL default 'ST',
  `parent_key` int(11) NOT NULL default '0',
  `parent_module` varchar(4) collate latin1_general_ci NOT NULL default '',
  PRIMARY KEY  (`key`)
) ENGINE=MyISAM AUTO_INCREMENT=2113 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;


